export default {
  props: {
    item: {
      type: Object,
      default: () => ({})
    }
  },
  data() {
    return {
      dialogDelete: false
    };
  },
  methods: {
    confirmDelete() {
      this.$emit('confirm-delete', this.item);
      this.dialogDelete = false;
    },
    cancelDelete() {
      this.$emit('cancel-delete');
      this.dialogDelete = false;
    }
  }
};
